import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  height: 100vh;
  width: 250px;
  background-color: #f5f5f5;
  padding: 15px;
`;

function SideNav() {
  return <Wrapper>SideNav</Wrapper>;
}

export default SideNav;
